import axios from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./../index.css";

function AdminDashboard() {
  const navigate = useNavigate();
  const [orders, setOrders] = useState([]);
  const [snacks, setSnacks] = useState([]);

  useEffect(() => {
    const user = JSON.parse(localStorage.getItem("user"));
    if (!user || user.userType !== "admin") {
      navigate("/");
      return;
    }

    // Fetch all orders
    axios.get("http://localhost:5000/api/orders")
      .then((res) => setOrders(res.data))
      .catch(() => alert("Failed to load orders"));

    // Fetch all snacks
    axios.get("http://localhost:5000/api/snacks")
      .then((res) => setSnacks(res.data))
      .catch(() => alert("Failed to load snacks"));
  }, []);

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <aside className="sidebar">
        <div className="logo">‚öôÔ∏è Admin Panel</div>
        <nav>
          <ul>
            <li className="active">üìä Dashboard</li>
            <li>üì¶ Manage Snacks</li>
            <li>üìú Order Management</li>
            <li onClick={() => { localStorage.clear(); navigate("/"); }}>üö™ Logout</li>
          </ul>
        </nav>
      </aside>

      {/* Main Content */}
      <div className="main-content">
        <header>
          <h1>Welcome, Admin</h1>
        </header>

        {/* Orders Table */}
        <div className="order-table-wrapper">
          <h2>üìú All Orders</h2>
          <table className="order-table">
            <thead>
              <tr>
                <th>Order Number</th>
                <th>User ID</th>
                <th>Snack</th>
                <th>Date Ordered</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {orders.length > 0 ? (
                orders.map((order) => (
                  <tr key={order.order_id}>
                    <td>{order.order_number}</td>
                    <td>{order.user_id}</td>
                    <td>{order.snack_name}</td>
                    <td>{new Date(order.date_ordered).toLocaleDateString()}</td>
                    <td>{order.order_status}</td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="5">No orders found.</td>
                </tr>
              )}
            </tbody>
          </table>
        </div>

        {/* Snacks List */}
        <div className="snacks-list">
          <h2>üç´ Manage Snacks</h2>
          <ul>
            {snacks.map((snack) => (
              <li key={snack.snack_id}>{snack.snack_name}</li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
